            errorDiv.style.display = 'none';
            resultDiv.style.display = 'none';

            if (!nftNumber) {
                errorDiv.textContent = 'Enter NFT number';
                errorDiv.style.display = 'block';
                return;
            }

            const nft = nftData.nfts[nftNumber];

            if (!nft) {
                errorDiv.textContent = `NFT #${nftNumber} not found`;
                errorDiv.style.display = 'block';
                return;
            }

            resultDiv.innerHTML = `
                <div class="nft-header">
                    <div class="nft-name">${nft.name}</div>
                    <div class="nft-rank">Rank: ${nft.rank} / ${nftData.metadata.total_supply}</div>
                    <div class="nft-rarity ${nft.overall_rarity_tier}">${nft.overall_rarity_tier}</div>
                </div>
                <div class="traits">
                    ${nft.traits.map(trait => `
                        <div class="trait">
                            <div class="trait-left">
                                <div class="trait-type">${trait.trait_type}</div>
                                <div class="trait-value">${trait.value}</div>
                                <div class="trait-stats">${trait.percentage}% (${trait.frequency}/${nftData.metadata.total_supply})</div>
                            </div>
                            <span class="rarity-badge ${trait.rarity_tier}">${trait.rarity_tier}</span>
                        </div>
                    `).join('')}
                </div>
            `;

            resultDiv.style.display = 'block';
        }

        document.getElementById('nftNumber').addEventListener('keypress', function(e) {
            if (e.key === 'Enter') {
                checkRarity();
            }
        });
    </script>
</body>
</html>
